The Heartbeat of Insight for Living: A Passion for Communicating Biblical Truth with Excellence&lt;br /&gt;

Insight for Living Ministries, the Bible-teaching radio ministry of Chuck Swindoll, is committed to excellence in communicating the truths of Scripture and the person of Jesus Christ in an accurate, clear, and practical manner.  Our desire is for people to grow in their understanding of God's plan for their lives and also to mature as authentic Christians.&lt;br /&gt;

In the summer of 1977, the sermons that Chuck Swindoll preached at the First Evangelical Free Church in Fullerton, California, were broadcast on 27 stations in the United States. Listeners responded immediately to the lively message of this down-to-earth pastor who could communicate God's truth in terms they could understand and apply to their lives. In 1979, the radio ministry of Insight for Living was officially born, beginning on just a handful of stations.&lt;br /&gt;

Today, more than two thousand stations carry the program around the world in six different languages.  Insight for Living Ministries' headquarters is located in Plano, Texas. We also maintain offices in Boronia for our Australian listeners, in São Paulo for our Brazilian listeners, in Abbotsford, British Columbia for our Canadian listeners, and in Dorking for our listeners in the United Kingdom and Europe. Insight for Living Ministries can be found on the web at www.insightworld.org.

